import React from "react";
import styled, {ThemeProvider} from "styled-components";
import PageWrapper from "../components/PageWrapper";
import blueTriangle from "../misc/images/tr_3.png";
import StyledTriangle from "../components/Triangles";
import rootTheme from "../themes/root";
import Project from "../components/Project";
import Arrow from "../components/Arrow";

const MyWorkPageWrapper = styled(PageWrapper)`
  display: flex;
  flex-flow: column;
`;

const TextWrapper = styled.section`
  font-size: ${props => props.theme.fontSize.xlarge}vw;
  font-weight: bold;
  justify-self: center;
  align-self: center;
  margin-bottom: 5vh;
`;

const ProjectsWrapper = styled.section`
  display: flex;
  flex-flow: column wrap;
  flex-wrap: wrap;
  justify-content: space-around;
  align-content: space-around;
`;

const MyWorkPage = () => {
    return (
        <ThemeProvider theme={rootTheme}>
            <MyWorkPageWrapper>
                <StyledTriangle as="img" src={blueTriangle} alt="blue" />
                <TextWrapper>Here you can find my work</TextWrapper>
                <ProjectsWrapper>
                    <Project>Chujek</Project>
                </ProjectsWrapper>
            </MyWorkPageWrapper>
        </ThemeProvider>
    )
}

export {MyWorkPage};
